import unittest
import json
import sys
sys.path.append('../backend_server')
from main import app

unittest.TestLoader.sortTestMethodsUsing =  None

jwt_token = None
class TestApp(unittest.TestCase):

    def setUp(self):
        # Create a test client for the app
        self.app = app.test_client()

    def test_test_route(self):
        # Test the '/test' route
        response = self.app.get('/test')
        data = json.loads(response.data)
        self.assertEqual(response.status_code, 200)
        self.assertEqual(data['status'], 'Server is up')

    def test_signup_route(self):
        # Test the '/signup' route
        data = {'username': 'testuser', 'password': 'testpassword'}
        response = self.app.post('/signup', json=data)
        data = json.loads(response.data)
        self.assertEqual(response.status_code, 400)
        self.assertEqual(data['message'], 'Username already exists.')

    def test_signin_route(self):
        # Test the '/signin' route
        global jwt_token
        data = {'username': 'testuser', 'password': 'testpassword'}
        response = self.app.post('/signin', json=data)
        data = json.loads(response.data)

        self.assertEqual(response.status_code, 200)
        self.assertTrue('access_token' in data)
        jwt_token = data['access_token']  # Store the JWT token

    def test_zidentify_route(self):
        global jwt_token
        # Test the '/identify' route using the stored JWT token
        if jwt_token is None:
            self.fail("JWT token not obtained from /signin")

        headers = {'Authorization': f'Bearer {jwt_token}'}

        response = self.app.get('/identify', headers=headers)
        data = json.loads(response.data)

        self.assertEqual(response.status_code, 200)
        self.assertTrue('message' in data)
        self.assertIn('Hello, testuser!', data['message'])

    def test_zcompare_route(self):
        global jwt_token
        # Test the '/compare' route
        data = {
        "image1": "",
        "image2": ""
        }
        if jwt_token is None:
            self.fail("JWT token not obtained from /signin")
        headers = {'Authorization': f'Bearer {jwt_token}', 'Content-Type': 'application/json'}

        response = self.app.post('/compare', json=data, headers=headers)
        data = json.loads(response.data)

        self.assertEqual(response.status_code, 200)
        self.assertTrue('result' in data)


if __name__ == '__main__':
    unittest.main()
